/*
    test(+N)
    The test/1 predicate tests the fillin puzzle using the test case specified
    by solving the puzzle and printing the solution to console.
    
    @param N test case number 
*/

test(N) :-
        test(N, Puzzle, Words),
        puzzle_solution(Puzzle, Words),
        maplist(writerow, Puzzle).

/*
    writerow(+Chars)
    The writerow/1 predicate writes a list of atoms, digits or variables to 
    the console in one line without spaces. 
    
    @param Chars array of characters
*/

writerow(Chars) :-
        maplist(write, Chars),
        nl.
